  [],\n\t\"revision_timestamp\": \"2016-07-27T22:45:53.064092\",\n\t\"name\": \"narrative-report-fish-springs-national-wildlife-refuge-dugway-ut-for-the-period-september--c1911\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Fish Springs
  National Wildlife Refuge outlines Refuge accomplishments from September through
  December of 1961. The report begins by summarizing the weather conditions, habitat
  conditions, water conditions, and food and cover during this period. Wildlife- including
  migratory birds, upland game birds, big game animals, furbearers, predators, rodents,
  mammals, raptors, reptiles, and disease- is also covered. The Refuge development
  and maintenance section discusses physical developments, collections and receipts,
  vegetation control, and planned burning. Resource management is outlined; topics
  include fur harvesting, peat mining, and frog farming. A progress report on field
  investigations and applied research is also provided. The public relations section
  of the report describes recreational uses, Refuge visitors, Refuge participation,
  hunting, violations, and safety. Items of interest, N-R forms, and photographs are
  attached.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\": [{\n\t\t\"key\":
